const Layout = (props) => {
	return (
		<AppProvider>
			<div>
				<Head>
					<title>Larawena</title>
					<script
						src='https://kit.fontawesome.com/96e8bce8d6.js'
						crossorigin='anonymous'
					></script>
					<link rel='stylesheet'>
						href='https:/bootswatch.com/4/pulse/bootstrap.min.css'
					</link>
				</Head>

				<Header />
				{props.children}
			</div>
		</AppProvider>
	);
};
export default Layout;
